// apple-internal

import XCTest
import Accelerate
@testable import ResearchKit

@available(iOS 14, *)
class ORKNewAudiometryTests: XCTestCase {
    override func setUpWithError() throws {}

    override func tearDownWithError() throws {}

    func testBark() throws {
        let audiometry = ORKNewAudiometry(channel: .left)
        let bark = audiometry.bark(Vector([500.0,3000.0,8000.0]))
        let expected = [4.55091682, 13.87463005, 19.70890583]
        
        for (value1, value2) in zip(bark.elements, expected) {
            XCTAssertEqual(value1, value2, accuracy: 0.00000001)
        }
    }
    
    func testHz() throws {
        let audiometry = ORKNewAudiometry(channel: .left)
        let hz = audiometry.hz(Vector([5.0, 13.0, 18.0]))
        let expected = [559.91330472, 2584.37385592, 6010.72495645]
        
        for (value1, value2) in zip(hz.elements, expected) {
            XCTAssertEqual(value1, value2, accuracy: 0.00000001)
        }
    }
    
    func testSigmoid() throws {
        let sigmoid = ORKNewAudiometry.sigmoid(Vector([1.0, 2.0, 3.5]))
        let expected = [0.73105858, 0.88079708, 0.97068777]
        
        for (value1, value2) in zip(sigmoid.elements, expected) {
            XCTAssertEqual(value1, value2, accuracy: 0.00000001)
        }
    }
    
    func testW() throws {
        let w = ORKNewAudiometry.w(Vector([-0.5, 0, 0.5, 2]))
        let expected = Matrix(elements: [0.23500371, 0.00000000, 0.00000000, 0.00000000,
                                         0.00000000, 0.25000000, 0.00000000, 0.00000000,
                                         0.00000000, 0.00000000, 0.23500371, 0.00000000,
                                         0.00000000, 0.00000000, 0.00000000, 0.10499359], rows: 4, columns: 4)
        
        XCTAssertEqual(w.shape, expected.shape)
        
        for (value1, value2) in zip(w.elements, expected.elements) {
            XCTAssertEqual(value1, value2, accuracy: 0.00000001)
        }
    }
    
