        let audiograms = [[250: 16.2, 500: 17.9, 1000: 17.3, 2000: 11.7, 4000: 12.2, 8000: 36.2],
                          [250: 5.63, 500: 7.66, 1000: 9.33, 2000: 7.54, 4000: 4.44, 8000: 14.7],
