                          [250: 12.3, 500: 14.7, 1000: 16.9, 2000: 18.5, 4000: 30.6, 8000: 47.6],
                          [250: 43.6, 500: 46.7, 1000: 49.1, 2000: 46.0, 4000: 37.9, 8000: 52.0]]
        
        for (index, audiogram) in audiograms.enumerated() {
            let newAudiometry = ORKNewAudiometry(channel: .left)
            let res = newAudiometry.initialSample(index)
            
            while newAudiometry.initialSampleEnded == false {
                let status = await withCheckedContinuation { continuation in
                    newAudiometry.nextStatus { continuation.resume(returning: ($0, $1)) }
                }
                
                if let stimulus = status.1 {
                    let testLevel = audiogram[Int(round(stimulus.frequency))]
                    newAudiometry.registerStimulusPlayback()
                    if stimulus.level > testLevel! {
                        newAudiometry.registerResponse(true)
                    } else {
                        newAudiometry.registerResponse(false)
                    }
                }
            }
            
            XCTAssertEqual(res.ySample.count, newAudiometry.ySample.count)
            for (value1, value2) in zip(res.ySample.elements, newAudiometry.ySample.elements) {
                XCTAssertEqual(value1, value2, accuracy: 0.00000001)
            }
            
            XCTAssertEqual(res.xSample.count, newAudiometry.xSample.count)
            for (value1, value2) in zip(res.xSample.elements, newAudiometry.xSample.elements) {
                XCTAssertEqual(value1, value2, accuracy: 0.00000001)
            }
        }
    }
    
